    def retrievemonthly(self,month_year):
        # print('alhudulillah','retrievemonthlydata')
        splityearmonth = re.split('/',month_year)
        month = splityearmonth[1]
        year = splityearmonth[0]
        monthstart = "{yy}-{mm}-{dd}".format(yy=year, mm=month, dd='01')
        monthend = "{yy}-{mm}-{dd}".format(yy=year, mm=month, dd='31')
        print(monthend, monthstart)
        # return CashManagement.retrievecompletedatabymonth(None, monthstart, monthend)
        return monthstart, monthend
    def datatoexcelsheet(self, fundata,filename):
        exceldataframe = {'Voucher no':[],
                          'Catagory': [],
                          'Subcatagory': [],
                          'Description': [],
                          'Amount': [],
                          'Date': []}
        # dumy_object = CashManagement('Maintainance', 'paint', 'quarter paint 2 bucket', 20000, '2021-10-16')
        # completedata = CashManagement.retrievecompletedata(dumy_object)
        for length in range(len(fundata)):
            for value in range(6):
                data = fundata[length][value]
                if value == 0:
                    exceldataframe['Voucher no'].append(data)
                if value == 1:
                    exceldataframe['Catagory'].append(data)
                if value == 2:
                    exceldataframe['Subcatagory'].append(data)
                if value == 3:
                    exceldataframe['Description'].append(data)
                if value == 4:
                    exceldataframe['Amount'].append(data)
                if value == 5:
                    exceldataframe['Date'].append(data)
        print('excel dat frame',exceldataframe)
        df = pd.DataFrame(exceldataframe, columns=['Voucher no','Catagory', 'Subcatagory', 'Description', 'Amount', 'Date'])
        file = './' + filename +'.xlsx'
        print('file name in filetoexcel',file)
        # ./ CashFlow.xlsx
        df.to_excel(file)
        print('data frame',df)

