        print("data",cashdata,'cash data',len(cashdata))
        exceldataframe = {'Cash': [],
                          'Dates': [],}
        # dumy_object = CashManagement('Maintainance', 'paint', 'quarter paint 2 bucket', 20000, '2021-10-16')
        # completedata = CashManagement.retrievecompletedata(dumy_object)
        for length in range(len(cashdata)):
            for value in range(2):
                data = cashdata[length][value]
                if value == 0:
                    print("0",data)
                    exceldataframe['Cash'].append(data)
                if value == 1:
                    print("1",data)
                    exceldataframe['Dates'].append(data)
        print("cash n dates",exceldataframe)
        df = pd.DataFrame(exceldataframe, columns=['Cash','Dates'])
        file = './' + 'Mnth Cash '+ formatfromdate + '.xlsx'
        print('cashfile name', file)
        # ./ CashFlow.xlsx
